import { Grid, Paper, Box } from "@material-ui/core";

const about = ()=>{
    return(<div>

        <Grid container justify='center' className="a1">
        <Grid container item  direction='column' justify='center' xs={12} sm={12} md={12} lg={6} className="a2">
          <Grid item>
            <Box className='a3'>Hello World</Box>
          </Grid>
        </Grid>
        <Grid  container item  direction='column' justify='center' xs={12} sm={12} md={12} lg={6}>
          <Paper >World</Paper>
        </Grid>
        </Grid>
     <style global jsx>{`
     .a1{
      margin-top: 0;
      margin-left: 0;
      margin-rigth: 0;
     }
     .a2{
      min-height: 65vh;
      padding-left: 48px;
      padding-right: 8px;
      background-color: #181357;
     }
     @media (min-width: 576px)
      {.a {
    text-align: left;
    }}
    @media (min-width: 480px)
      {.a2 {
    text-align: center;
    }}
     `}</style>
    </div>)
}

export default about;
